// Generate workflow execution ID and capture start time
const workflow_execution_id = `wf-${Date.now()}-${Math.random().toString(36).substr(2, 6)}`;
const started_at = new Date().toISOString();

return [{
  json: {
    workflow_execution_id,
    started_at,
    workflow_name: 'Daily AI News - v3'
  }
}];

// Transform Hacker News API response to Article format
const response = $input.first().json;
const hits = response.hits || [];

return hits.map(hit => ({
  json: {
    title: hit.title || '',
    link: hit.url || `https://news.ycombinator.com/item?id=${hit.objectID}`,
    guid: hit.objectID,
    pubDate: hit.created_at,
    description: `${hit.title} (${hit.points} points, ${hit.num_comments} comments)`,
    source: 'Hacker News'
  }
}));

// Transform Reddit API response to Article format
// Filter for posts with score > 100
const response = $input.first().json;
const posts = response.data?.children || [];

return posts
  .filter(post => post.data.score > 100)
  .map(post => ({
    json: {
      title: post.data.title || '',
      link: `https://reddit.com${post.data.permalink}`,
      guid: post.data.id,
      pubDate: new Date(post.data.created_utc * 1000).toISOString(),
      description: (post.data.selftext || post.data.title).substring(0, 500),
      source: 'Reddit r/MachineLearning'
    }
  }));

// Transform Reddit r/LocalLLaMA API response to Article format
// Filter for posts with score > 50 (lower threshold for niche community)
const response = $input.first().json;
const posts = response.data?.children || [];

return posts
  .filter(post => post.data.score > 50)
  .map(post => ({
    json: {
      title: post.data.title || '',
      link: `https://reddit.com${post.data.permalink}`,
      guid: post.data.id,
      pubDate: new Date(post.data.created_utc * 1000).toISOString(),
      description: (post.data.selftext || post.data.title).substring(0, 500),
      source: 'Reddit r/LocalLLaMA'
    }
  }));

// Dedup and format articles for Claude Service
const articles = $input.all();
const seen = new Set();
const now = new Date();
const cutoff = new Date(now.getTime() - 7 * 24 * 60 * 60 * 1000); // 7 days ago

const unique = [];

for (const item of articles) {
  const data = item.json;

  // Extract fields (handle RSS and API structure variations)
  const url = data.link || data.guid || data.url || '';
  const title = data.title || '';
  const pubDate = data.pubDate || data.isoDate || data.date || data.created_at || '';
  const description = data.description || data.summary || data.content || data.contentSnippet || '';
  const source = data.source || extractDomain(url);

  // Dedup key: URL or normalized title
  const dedupKey = url || normalizeTitle(title);

  if (!dedupKey || seen.has(dedupKey)) continue;
  seen.add(dedupKey);

  // Filter articles older than 7 days
  if (pubDate) {
    const articleDate = new Date(pubDate);
    if (articleDate < cutoff) continue;
  }

  unique.push({
    json: {
      title: cleanText(title),
      url: url,
      description: cleanText(description).substring(0, 500),
      pub_date: pubDate,
      source: source
    }
  });

  if (unique.length >= 50) break; // Increased limit for more sources
}

console.log(`Dedup: ${articles.length} articles -> ${unique.length} unique`);
return unique;

// Helper functions
function normalizeTitle(title) {
  return title.toLowerCase().replace(/[^a-z0-9]/g, '');
}

function cleanText(text) {
  return text.replace(/<[^>]*>/g, '').replace(/\s+/g, ' ').trim();
}

function extractDomain(url) {
  try {
    return new URL(url).hostname.replace('www.', '');
  } catch {
    return 'unknown';
  }
}

// Prepare payload for Claude Service with mission and workflow execution ID
const articles = $input.all().map(item => item.json);
const initData = $('Init Execution').first().json;

console.log(`Sending ${articles.length} articles to Claude Service (mission: ai-news)`);

return [{
  json: {
    articles: articles,
    mission: "ai-news",
    workflow_execution_id: initData.workflow_execution_id
  }
}];

// Format response for Discord Bot API - creates publish payload
const response = $input.first().json;

if (!response.success) {
  throw new Error(`Claude CLI failed: ${response.error}`);
}

// Get the structured digest (new format from MCP)
const digest = response.digest;
if (!digest) {
  throw new Error('No digest found in response - Claude did not call submit_digest');
}

// Get digest_id from response (saved by MCP submit_digest)
const digest_id = response.digest_id || 0;
const digest_date = digest.digest?.date || new Date().toISOString().split('T')[0];

// Build the content object for the bot API
// The bot will build the embeds from this structured content
const content = {
  headlines: digest.headlines || [],
  research: digest.research || [],
  industry: digest.industry || [],
  watching: digest.watching || [],
  metadata: {
    articles_analyzed: response.article_count || 0,
    web_searches: digest.metadata?.web_searches || 0,
    fact_checks: digest.metadata?.fact_checks || 0,
    deep_dives: digest.metadata?.deep_dives || 0
  }
};

console.log(`Sending digest ${digest_id} to Discord Bot API`);

return [{
  json: {
    type: 'daily',
    mission_id: 'ai-news',
    digest_id: digest_id,
    date: digest_date,
    content: content
  }
}];

// Prepare success log data for /log-workflow endpoint
const initData = $('Init Execution').first().json;
const payloadData = $('Prepare Payload').first().json;
const claudeResponse = $('Call Claude Service').first().json;
const botResponse = $('Publish via Bot').first().json;

const finished_at = new Date().toISOString();

// Calculate articles count from payload
const articles_count = payloadData.articles ? payloadData.articles.length : 0;

// Extract claude execution ID and digest info
const claude_execution_id = claudeResponse.execution_id || null;
const digest_id = claudeResponse.digest_id || null;
const digest = claudeResponse.digest || {};
const articles_saved = (digest.headlines?.length || 0) + (digest.research?.length || 0) + (digest.industry?.length || 0) + (digest.watching?.length || 0);
const db_saved = digest_id !== null;

// Extract Discord publication info from bot response
const discord_message_id = botResponse.message_id || null;
const discord_channel_id = botResponse.channel_id || null;
const discord_sent = botResponse.posted_to_discord === true;

// Build nodes_executed list (updated for v3 sources)
const nodes_executed = [
  { name: 'Init Execution', status: 'success', error: null },
  { name: 'RSS TechCrunch AI', status: 'success', error: null },
  { name: 'RSS OpenAI', status: 'success', error: null },
  { name: 'RSS Google AI', status: 'success', error: null },
  { name: 'RSS HuggingFace', status: 'success', error: null },
  { name: 'RSS arXiv AI/ML', status: 'success', error: null },
  { name: 'RSS The Verge AI', status: 'success', error: null },
  { name: 'RSS Ars Technica AI', status: 'success', error: null },
  { name: 'HTTP Hacker News', status: 'success', error: null },
  { name: 'HTTP Reddit ML', status: 'success', error: null },
  { name: 'HTTP Reddit LocalLLaMA', status: 'success', error: null },
  { name: 'Merge Articles', status: 'success', error: null },
  { name: 'Dedup & Format', status: 'success', error: null },
  { name: 'Prepare Payload', status: 'success', error: null },
  { name: 'Call Claude Service', status: 'success', error: null },
  { name: 'Format Bot Payload', status: 'success', error: null },
  { name: 'Publish via Bot', status: 'success', error: null }
];

return [{
  json: {
    workflow_execution_id: initData.workflow_execution_id,
    workflow_name: initData.workflow_name,
    started_at: initData.started_at,
    finished_at: finished_at,
    status: 'success',
    error_message: null,
    error_node: null,
    nodes_executed: nodes_executed,
    articles_count: articles_count,
    claude_execution_id: claude_execution_id,
    discord_sent: discord_sent,
    discord_message_id: discord_message_id,
    discord_channel_id: discord_channel_id,
    digest_id: digest_id,
    db_saved: db_saved,
    articles_saved: articles_saved
  }
}];

// Prepare error log data for /log-workflow endpoint
const errorData = $input.first().json;
const finished_at = new Date().toISOString();

let workflow_execution_id = null;
let started_at = null;
let workflow_name = 'Daily AI News - v3';
let claude_execution_id = null;
let digest_id = null;

try {
  const initData = $('Init Execution').first().json;
  workflow_execution_id = initData.workflow_execution_id;
  started_at = initData.started_at;
  workflow_name = initData.workflow_name;
} catch (e) {
  workflow_execution_id = `wf-error-${Date.now()}-${Math.random().toString(36).substr(2, 6)}`;
  started_at = finished_at;
}

// Try to get claude execution ID if available
try {
  const claudeResponse = $('Call Claude Service').first().json;
  claude_execution_id = claudeResponse.execution_id || null;
  digest_id = claudeResponse.digest_id || null;
} catch (e) {}

const error_message = errorData.execution?.error?.message || 
                      errorData.error?.message || 
                      'Unknown error';
const error_node = errorData.execution?.lastNodeExecuted || 
                   errorData.workflow?.lastNodeExecuted ||
                   'Unknown node';

const nodes_executed = [
  { name: error_node, status: 'error', error: error_message }
];

return [{
  json: {
    workflow_execution_id: workflow_execution_id,
    workflow_name: workflow_name,
    started_at: started_at,
    finished_at: finished_at,
    status: 'error',
    error_message: error_message,
    error_node: error_node,
    nodes_executed: nodes_executed,
    articles_count: 0,
    claude_execution_id: claude_execution_id,
    discord_sent: false,
    discord_message_id: null,
    discord_channel_id: null,
    digest_id: digest_id,
    db_saved: false,
    articles_saved: 0
  }
}];
